import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import './Events.css'
import bailey from './Images/Bailey.png';


function Events() {
  const events = [
    {
      image: bailey,
      title: 'Event 1',
      description: 'Details about event 1',
    },
    {
      image: bailey,
      title: 'Event 2',
      description: 'Details about event 2',
    },
    // Add more events as needed
  ];
  return (
    <>
    <div className='highlights' style={{ fontSize: '40px', marginBottom: '20px', marginTop: '70px'}}>
        FRN@Brown Latest Happenings
      </div>
      <div className="event-list">
          {events.map((event, index) => (
            <Event 
              key={index}
              image={event.image}
              title={event.title}
              description={event.description}
            />
          ))}
        </div>
      <Footer />
    </>
  );
}

export default Events;
